import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import ListaSeries from './components/ListaSeries';
import Formulario from './components/Formulario';
import BuscarSerie from './components/BuscarSerie';

const App = () => {
    return (
        <Router>
            <div className="App">
                <nav>
                    <ul>
                        <li>
                            <Link to="/">Lista de Series</Link>
                        </li>
                        <li>
                            <Link to="/nueva-serie">Nueva Serie</Link>
                        </li>
                        <li>
                            <Link to="/buscar-serie">Buscar Serie</Link>
                        </li>
                    </ul>
                </nav>
                <Switch>
                    <Route path="/" exact component={ListaSeries} />
                    <Route path="/nueva-serie" render={() => <Formulario isUpdating={false} />} />
                    <Route path="/actualizar-serie/:id" render={(props) => <Formulario serieId={props.match.params.id} isUpdating={true} />} />
                    <Route path="/buscar-serie" component={BuscarSerie} />
                </Switch>
            </div>
        </Router>
    );
};

export default App;
